import * as React from 'react';
import { styled } from '@mui/material/styles';
import Grid from '@mui/material/Grid';
import Paper from '@mui/material/Paper';
import Typography from '@mui/material/Typography';
import ButtonBase from '@mui/material/ButtonBase';
import InfoRoundedIcon from '@mui/icons-material/InfoRounded';
import Button from '@mui/material/Button';

const Img = styled('img')({
  margin: 'auto',
  display: 'block',
  maxWidth: '100%',
  maxHeight: '100%',
});

export default function ComplexGrid() {
  return (
      <Grid container spacing={2}>
        <Paper
        sx={{
            p: 2,
            margin: 'auto',
            width: 300,
            height:250,
            flexGrow: 1,
            backgroundColor: (theme) =>
            theme.palette.mode === 'dark' ? '#1A2027' : '#f2f3f5',
        }}
        >
        <Grid container spacing={0}>
            <Grid item sx={{width:'100%', height:'300px'}}>
                <div style={{display:'flex'}}>
                    <InfoRoundedIcon />
                </div>
                <div style={{width:'100%', fontWeight:'bolder', fontSize:28}}>
                    <p style={{margin:0}}>MetaParser</p>
                </div>
                <div style={{display:'flex', marginTop:160, justifyContent:'right'}}>
                    <Button variant="outlined">Launch</Button>
                </div>
            </Grid>
        </Grid>
        </Paper>

        <Paper
        sx={{
        p: 2,
        margin: 'auto',
        width: 300,
        height:250,
        flexGrow: 1,
        backgroundColor: (theme) =>
            theme.palette.mode === 'dark' ? '#1A2027' : '#f2f3f5',
        }}
        >
        <Grid container spacing={2}>
            <Grid item sx={{width:'100%', height:'300px'}}>
                <div style={{display:'flex'}}>
                    <InfoRoundedIcon />
                </div>
                <div style={{width:'100%', fontWeight:'bolder', fontSize:28}}>
                    <p style={{margin:0}}>MetaParser</p>
                </div>
                <div style={{display:'flex', marginTop:160, justifyContent:'right'}}>
                    <Button variant="outlined">Launch</Button>
                </div>
            </Grid>
        </Grid>
        </Paper>
    </Grid>
  );
}
